@import "../../../ui_kit/buttons/default-button";

.slides_container {
    overflow: hidden;
    width: 100%;
    height: 612px;
    padding-left: 10%;
    margin-bottom: 0px;
    position: relative;
    text-align: left;

    .slider-button{
        background: #E5E31F;
        color: #2A4F71;
        width: 240px;
        margin-top: 108px;
    }
}

.slides {
    width: 300%;
    margin-left: -100%;
    height: 100%;
    position: relative;
}

.slider {
    width: 33%;
    height: 100%;
    float: left;
    position: relative;
    z-index: 1;
    overflow: hidden;
}

.slider:nth-of-type(1) {
    margin-left: 33%;
}

.content-txt {
    width: 48%;
    float: left;
}

.content-img {
    position: absolute;
    width: 60%;
    left: 49%;
    bottom: 0;
}

#width {
    width: 70%;
    max-width: 600px;
}

.content-img img {
    max-width: 510px;
    position: absolute;
    bottom: 0;
    width: inherit;
}

.content-txt h1 {
    font-family: Proxima Nova;
    font-weight: bolder;
    font-size: 64px;
    color: #FFFFFF;
    margin-top: 156px;
    margin-bottom: 18px;
}

.content-txt h2 {
    font-family: Proxima Nova;
    font-weight: normal;
    font-size: 16px;
    color: #FFFFFF;
    margin-bottom: 87px;
    margin-right: 20px;
}

/* Switch */

.switch {
    width: 52px;
    height: 14px;
    margin: auto;
    position: absolute;
    top: 672px;
    left: 0px;
    bottom: 32px;
    right: 0px;
    z-index: 99;
}

.switch>ul {
    padding: 0px;
    margin: 0px;
    list-style: none;
}

.switch>ul>li {
    width: 8px;
    height: 8px;
    border: 3px solid rgb(38, 65, 96);
    border-radius: 4px;
    background-color: rgb(38, 65, 96, 0.0);
    margin: 0px 3px;
    float: left;
}

.switch ul {
    padding: 0px 6px;
    overflow: hidden;
}

